webpackJsonp([0x9f0fe968e671],{356:function(e,t){e.exports={data:{markdownRemark:{html:'<h3>Create a container with a mongo database and connect to it</h3>\n<p>Start with displaying all currently running containers:</p>\n<pre><code class="language-bash">docker ps\n</code></pre>\n<p>Then create locally the container associated with the mongo docker image:</p>\n<pre><code class="language-bash">docker run -p 27017:27017 -d mongo\n</code></pre>\n<p>The resulting mongo db container is then displayed by executing another time </p>\n<pre><code class="language-bash">docker ps\n</code></pre>\n<p>Information on the running container like the following is displayed:</p>\n<pre><code>CONTAINER ID        IMAGE               COMMAND                  CREATED             STATUS              PORTS                      NAMES\n2c6a61aba41b        mongo               "docker-entrypoint.sâ€¦"   3 minutes ago       Up 3 minutes        0.0.0.0:27017->27017/tcp   clever_dubinsky\n</code></pre>\n<p>Connection to the database at url localhost:27017 can be open using for instance the robo-3t nosql database editor.\nFinally, the container when not needed anymore can be stopped with:</p>\n<pre><code>docker stop 2c6a61aba41b\n</code></pre>',frontmatter:{title:"Docker Recipes",date:"March 05, 2019",path:"/docker",tags:["docker","container","devops"],excerpt:"Some Docker Recipes"}}},pathContext:{prev:{html:'<h3>Communities</h3>\n<p><a href="https://www.codewars.com/users/nperon">codewars</a></p>\n<p><a href="https://stackoverflow.com/users/10363360">stackoverflow</a></p>\n<p><a href="https://github.com/nperon">github</a></p>\n<p><a href="https://www.linkedin.com/in/nicolas-peron-52b250140/">linkedin</a></p>\n<p><a href="https://www.facebook.com/profile.php?id=100012153432065">facebook</a></p>\n<p><a href="https://twitter.com/NicolasPeron5">twitter</a></p>\n<h3>Trainings / Completed online courses</h3>\n<p><a href="http://ude.my/UC-LTEODNLK"> via @udemy: Ionic 4 Crash Course</a></p>\n<p><a href="https://www.udemy.com/certificate/UC-3BOGQ0KF/"> via @udemy: Redux Saga (with React and Redux): Fast-track intro course</a></p>\n<p><a href="https://www.udemy.com/certificate/UC-WVGZWOCD/"> via @udemy: Up and Runninng with PostgreSQL 11</a></p>\n<p><a href="https://www.udemy.com/certificate/UC-4TKNLZQ4/"> via @udemy: The Ultimate MySQL Bootcamp: Go from SQL Beginner to Expert</a></p>\n<p><a href="https://www.udemy.com/certificate/UC-ITXKXIZ7/"> via @udemy: Asynchronous JavaScript: Promises, Callbacks, Async Await</a></p>\n<p><a href="https://www.udemy.com/certificate/UC-81NFLFR5/"> via @udemy: Jenkins for Professionals</a></p>\n<p><a href="https://www.udemy.com/certificate/UC-52TXS07R/"> via @udemy: JavaScript Cookie Tester web application</a></p>\n<p><a href="https://www.udemy.com/certificate/UC-D1K1BCTL/"> via @udemy: Object Oriented PHP &#x26; MVC</a></p>',id:"/Users/nperon/Documents/workshop/src/pages/2019-01-01-cv/index.md absPath of file >>> MarkdownRemark",frontmatter:{date:"2019-01-01T22:09:20.235Z",path:"/cv",title:"Nicolas's CV",excerpt:"My CV",tags:["cv","work"]}},next:null}}}});
